import React, { Component } from 'react';
import './App.css';
import AppNavbar from './AppNavbar';
import { Link } from 'react-router-dom';
import { Button, Container } from 'reactstrap';

class Home extends Component {
    render() {
        return (
            <div>
                <AppNavbar/>
                <Container fluid>
                    <Button color="link"><Link to="/clients?tid=1&fid=2&pid=3">Tenant 1 Clients</Link></Button>
                    <Button color="link"><Link to="/clients?tid=2&fid=2&pid=3">Tenant 2 Clients</Link></Button>
                    <Button color="link"><Link to="/clients?tid=1&fid=2&pid=3&">Tenant 1 Clients for User Buland</Link></Button>
                    <Button color="link"><Link to="/clients?tid=2&fid=2&pid=3">Tenant 2 Clients for User Buland</Link></Button>

                </Container>
            </div>
        );
    }
}

export default Home;
